Getting -> Result<..> to work in the context of main and #[test] s is not magic. It is all backed up by a Termination trait which all valid return types of main and testing functions must implement. The trait is defined as: pub trait Termination { fn report(self) -> i32;
} When setting up the entry point for your application, the compiler will use this trait and call .report() on the Result of the main function you have written. Two simplified example implementations of this trait for Result and () are: # #![feature(process_exitcode_placeholder, termination_trait_lib)]
# use std::process::ExitCode;
# use std::fmt;
#
# pub trait Termination { fn report(self) -> i32; } impl Termination for () { fn report(self) -> i32 { # use std::process::Termination; ExitCode::SUCCESS.report() }
} impl<E: fmt::Debug> Termination for Result<(), E> { fn report(self) -> i32 { match self { Ok(()) => ().report(), Err(err) => { eprintln!("Error: {:?}", err); # use std::process::Termination; ExitCode::FAILURE.report() } } }
} As you can see in the case of () , a success code is simply returned. In the case of Result , the success case delegates to the implementation for () but prints out an error message and a failure exit code on Err(..) . To learn more about the finer details, consult either the tracking issue or the RFC .

